-- Enable PostGIS extension
CREATE EXTENSION IF NOT EXISTS postgis;
CREATE EXTENSION IF NOT EXISTS postgis_topology;

-- Update GEOM
CREATE OR REPLACE FUNCTION public.update_geometry()
 RETURNS trigger
 LANGUAGE plpgsql
AS $function$
BEGIN
  NEW.geom = ST_SetSRID(
    ST_MakePoint(NEW.longitude, NEW.latitude),
    4326
  );
  RETURN NEW;
END;
$function$
;

-- public."location" definition

-- Drop table

-- DROP TABLE public."location";

-- Enable PostGIS extension
CREATE EXTENSION IF NOT EXISTS postgis;
CREATE EXTENSION IF NOT EXISTS postgis_topology;

-- Function to automatically update geometry from lat/lon
CREATE OR REPLACE FUNCTION update_geometry()
RETURNS TRIGGER AS $$
BEGIN
    NEW.geom = ST_SetSRID(ST_MakePoint(NEW.longitude, NEW.latitude), 4326);
    RETURN NEW;
END;
$$ LANGUAGE plpgsql;

