-- public."location" definition
CREATE TABLE IF NOT EXISTS public."location" (
	id int8 GENERATED BY DEFAULT AS IDENTITY( INCREMENT BY 1 MINVALUE 1 MAXVALUE 9223372036854775807 START 1 CACHE 1 NO CYCLE) NOT NULL,
	loc_name text NULL,
	category text NULL,
	confidence numeric NULL,
	street text NULL,
	locality text NULL,
	postcode text NULL,
	region text NULL,
	country text NULL,
	latitude numeric(10, 8) NOT NULL,
	longitude numeric(11, 8) NOT NULL,
	geom public.geometry(point, 4326) NULL,
	created_at timestamp DEFAULT CURRENT_TIMESTAMP NOT NULL,
	updated_at timestamp DEFAULT CURRENT_TIMESTAMP NULL,
	CONSTRAINT locations_pkey PRIMARY KEY (id)
);

CREATE INDEX IF NOT EXISTS locations_category_idx ON public.location USING btree (category);
CREATE INDEX IF NOT EXISTS locations_confidence_idx ON public.location USING btree (confidence);
CREATE INDEX IF NOT EXISTS locations_geom_idx ON public.location USING gist (geom);
CREATE INDEX IF NOT EXISTS locations_locality_idx ON public.location USING btree (locality);

-- Column comments
COMMENT ON COLUMN public."location".loc_name IS 'Business/place name';
COMMENT ON COLUMN public."location".category IS 'e.g., restaurant, coffee_shop, hospital';
COMMENT ON COLUMN public."location".confidence IS 'Overture confidence score 0-1';
COMMENT ON COLUMN public."location".street IS 'Full street address';
COMMENT ON COLUMN public."location".locality IS 'City/town name';
COMMENT ON COLUMN public."location".postcode IS 'Postal/ZIP code';
COMMENT ON COLUMN public."location".region IS 'State/province code (e.g., PA)';
COMMENT ON COLUMN public."location".country IS 'Country code';
COMMENT ON COLUMN public."location".geom IS 'PostGIS GEOMETRY(Point, 4326) - auto-generated from lat/lon';

-- Table Triggers
DROP TRIGGER IF EXISTS locations_geom_trigger ON public.location;
CREATE TRIGGER locations_geom_trigger BEFORE INSERT OR UPDATE ON public.location 
FOR EACH ROW EXECUTE FUNCTION update_geometry();

-- public.survey definition
CREATE TABLE IF NOT EXISTS public.survey (
	id int8 GENERATED ALWAYS AS IDENTITY( INCREMENT BY 1 MINVALUE 1 MAXVALUE 9223372036854775807 START 1 CACHE 1 NO CYCLE) NOT NULL,
	"name" text NOT NULL,
	description text NULL,
	CONSTRAINT survey_pk PRIMARY KEY (id)
);

-- public.survey_question definition
CREATE TABLE IF NOT EXISTS public.survey_question (
	id int8 GENERATED ALWAYS AS IDENTITY( INCREMENT BY 1 MINVALUE 1 MAXVALUE 9223372036854775807 START 1 CACHE 1 NO CYCLE) NOT NULL,
	question_text text NOT NULL,
	survey_id int8 NOT NULL,
	question_type text NULL,
	order_index int8 DEFAULT 0 NOT NULL,
	CONSTRAINT survey_question_pk PRIMARY KEY (id)
);

-- public.location_attempt definition
CREATE TABLE IF NOT EXISTS public.location_attempt (
	id int8 GENERATED BY DEFAULT AS IDENTITY( INCREMENT BY 1 MINVALUE 1 MAXVALUE 9223372036854775807 START 1 CACHE 1 NO CYCLE) NOT NULL,
	turf_location_id int8 NOT NULL,
	user_id text NOT NULL,
	attempt_note text NULL,
	created_at timestamp DEFAULT now() NOT NULL,
	contact_made bool DEFAULT false NOT NULL,
	updated_at timestamp DEFAULT now() NOT NULL,
	CONSTRAINT location_attempt_unique UNIQUE (turf_location_id, user_id),
	CONSTRAINT location_attempts_pkey PRIMARY KEY (id)
);

-- public.survey_question_response definition
CREATE TABLE IF NOT EXISTS public.survey_question_response (
	id int8 GENERATED ALWAYS AS IDENTITY( INCREMENT BY 1 MINVALUE 1 MAXVALUE 9223372036854775807 START 1 CACHE 1 NO CYCLE) NOT NULL,
	response_value text NULL,
	survey_question_id int8 NOT NULL,
	location_attempt_id int8 NOT NULL,
	created_at timestamp DEFAULT now() NOT NULL,
	updated_at timestamp DEFAULT now() NULL,
	CONSTRAINT survey_question_response_pk PRIMARY KEY (id),
	CONSTRAINT survey_question_response_unique UNIQUE (survey_question_id, location_attempt_id)
);

-- public.turf definition
CREATE TABLE IF NOT EXISTS public.turf (
	id int8 GENERATED BY DEFAULT AS IDENTITY( INCREMENT BY 1 MINVALUE 1 MAXVALUE 9223372036854775807 START 1 CACHE 1 NO CYCLE) NOT NULL,
	code varchar(12) NOT NULL,
	created_at timestamp DEFAULT CURRENT_TIMESTAMP NOT NULL,
	expires_at timestamp NOT NULL,
	author_id text NOT NULL,
	bounds public.geometry NOT NULL,
	survey_id int8 NULL,
	CONSTRAINT turfs_pkey PRIMARY KEY (id)
);

COMMENT ON COLUMN public.turf.code IS 'Code used to access the turf';
COMMENT ON COLUMN public.turf.expires_at IS 'Possible default, 1 week in the future.';

-- public.turf_location definition
CREATE TABLE IF NOT EXISTS public.turf_location (
	id int8 GENERATED BY DEFAULT AS IDENTITY( INCREMENT BY 1 MINVALUE 1 MAXVALUE 9223372036854775807 START 1 CACHE 1 NO CYCLE) NOT NULL,
	turf_id int8 NOT NULL,
	location_id int8 NOT NULL,
	created_at timestamp DEFAULT CURRENT_TIMESTAMP NOT NULL,
	CONSTRAINT turf_locations_pkey PRIMARY KEY (id),
	CONSTRAINT turf_locations_turf_id_location_id_key UNIQUE (turf_id, location_id)
);

-- public.turf_user definition
CREATE TABLE IF NOT EXISTS public.turf_user (
	id int8 GENERATED BY DEFAULT AS IDENTITY( INCREMENT BY 1 MINVALUE 1 MAXVALUE 9223372036854775807 START 1 CACHE 1 NO CYCLE) NOT NULL,
	turf_id int8 NOT NULL,
	user_id text NOT NULL,
	CONSTRAINT turf_user_pk PRIMARY KEY (id),
	CONSTRAINT turf_user_unique UNIQUE (turf_id, user_id)
);

COMMENT ON TABLE public.turf_user IS 'Authorizes a user to view a given turf by id';

-- Foreign keys (with IF NOT EXISTS workaround)
DO $$ 
BEGIN
    IF NOT EXISTS (SELECT 1 FROM pg_constraint WHERE conname = 'survey_question_survey_fk') THEN
        ALTER TABLE public.survey_question ADD CONSTRAINT survey_question_survey_fk 
        FOREIGN KEY (survey_id) REFERENCES public.survey(id) ON DELETE CASCADE ON UPDATE CASCADE;
    END IF;

    IF NOT EXISTS (SELECT 1 FROM pg_constraint WHERE conname = 'location_attempts_turf_location_fk') THEN
        ALTER TABLE public.location_attempt ADD CONSTRAINT location_attempts_turf_location_fk 
        FOREIGN KEY (turf_location_id) REFERENCES public.turf_location(id) ON DELETE CASCADE;
    END IF;

    IF NOT EXISTS (SELECT 1 FROM pg_constraint WHERE conname = 'location_attempts_user_fk') THEN
        ALTER TABLE public.location_attempt ADD CONSTRAINT location_attempts_user_fk 
        FOREIGN KEY (user_id) REFERENCES public."user"(id) ON DELETE CASCADE ON UPDATE CASCADE;
    END IF;

    IF NOT EXISTS (SELECT 1 FROM pg_constraint WHERE conname = 'survey_question_response_location_attempt_fk') THEN
        ALTER TABLE public.survey_question_response ADD CONSTRAINT survey_question_response_location_attempt_fk 
        FOREIGN KEY (location_attempt_id) REFERENCES public.location_attempt(id) ON DELETE CASCADE ON UPDATE CASCADE;
    END IF;

    IF NOT EXISTS (SELECT 1 FROM pg_constraint WHERE conname = 'survey_question_response_survey_question_fk') THEN
        ALTER TABLE public.survey_question_response ADD CONSTRAINT survey_question_response_survey_question_fk 
        FOREIGN KEY (survey_question_id) REFERENCES public.survey_question(id) ON DELETE CASCADE ON UPDATE CASCADE;
    END IF;

    IF NOT EXISTS (SELECT 1 FROM pg_constraint WHERE conname = 'turf_survey_fk') THEN
        ALTER TABLE public.turf ADD CONSTRAINT turf_survey_fk 
        FOREIGN KEY (survey_id) REFERENCES public.survey(id) ON DELETE CASCADE ON UPDATE CASCADE;
    END IF;

    IF NOT EXISTS (SELECT 1 FROM pg_constraint WHERE conname = 'turfs_user_fk') THEN
        ALTER TABLE public.turf ADD CONSTRAINT turfs_user_fk 
        FOREIGN KEY (author_id) REFERENCES public."user"(id) ON DELETE CASCADE ON UPDATE CASCADE;
    END IF;

    IF NOT EXISTS (SELECT 1 FROM pg_constraint WHERE conname = 'turf_locations_location_fk') THEN
        ALTER TABLE public.turf_location ADD CONSTRAINT turf_locations_location_fk 
        FOREIGN KEY (location_id) REFERENCES public."location"(id) ON DELETE CASCADE;
    END IF;

    IF NOT EXISTS (SELECT 1 FROM pg_constraint WHERE conname = 'turf_locations_turf_fk') THEN
        ALTER TABLE public.turf_location ADD CONSTRAINT turf_locations_turf_fk 
        FOREIGN KEY (turf_id) REFERENCES public.turf(id) ON DELETE CASCADE;
    END IF;

    IF NOT EXISTS (SELECT 1 FROM pg_constraint WHERE conname = 'turf_user_turf_fk') THEN
        ALTER TABLE public.turf_user ADD CONSTRAINT turf_user_turf_fk 
        FOREIGN KEY (turf_id) REFERENCES public.turf(id) ON DELETE CASCADE ON UPDATE CASCADE;
    END IF;

    IF NOT EXISTS (SELECT 1 FROM pg_constraint WHERE conname = 'turf_user_user_fk') THEN
        ALTER TABLE public.turf_user ADD CONSTRAINT turf_user_user_fk 
        FOREIGN KEY (user_id) REFERENCES public."user"(id) ON DELETE CASCADE ON UPDATE CASCADE;
    END IF;
END $$;

